import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import UserForm from './Register/user';
const App = () => {
  return (
            <Router>
            <Routes>
                <Route exact path="/" element={<UserForm />}/>
                {/* <>
                    <Route exact path="/Register" element={<Register/>}/>
                </> */}

            </Routes>
        </Router>
  );
};

export default App;
